import React from "react";

function Jumbotron({ children }) {
  return (
    <div
      style={{ height: 150, clear: "both", textAlign: "center" , paddingTop: "33%", backgroundColor: "none"}}
    >
      {children}
    </div>
  );
}

export default Jumbotron;
